import React from "react";
import ButtonIncrement from "../component/buttonIncrement";
import ButtonDecrement from "../component/buttonDecrement";
import Result from "../../couter/component/result";
const AppCouter = ()=>{
    return(
        <>
            <Result/>
            <ButtonDecrement />
            <ButtonIncrement />
        </>
    )
}
export default AppCouter;
